INSERT INTO `categories_category` VALUES (1,NULL,'Bemaling',1,'bemaling',1,76,1,0,'Bemaling','Berekeningen voor de bemaling van bouwputten. Berekenen van het benodigde debiet om de gewenste verlaging te handhaven/bereiken en berekeningen van de resulterende verlaging bij een gegeven debiet.\r\n\r\n','','','uploads/categories/thumbnails/bemaling.png',285,195,'',1),(2,1,'Freatisch',1,'freatisch',2,27,1,1,'Freatisch','Een freatische watervoerende laag op een ondoorlatende basis (SBR, 2003). ','','','uploads/categories/thumbnails/Icoon_freatisch_alg_copy.gif',256,256,'',1),(3,1,'Freatisch boven semi-spanningswater',1,'freatisch-boven-semi-spanningswater',28,41,1,1,'Freatisch boven spanningswater','Een freatische watervoerende laag boven een laag met onvolkomen spanningswater op een ondoorlatende basis. De freatische laag en de laag met onvolkomen spanningswater worden gescheiden door een matig tot slecht doorlatende laag (SBR, 2003).','','','uploads/categories/thumbnails/Icoon_freatisch_bovensp_copy_1.gif',256,256,'',1),(4,2,'Stationair',1,'stationair',9,14,1,2,'Stationair','Voor deze situatie wordt de formule van Dupuit gebruikt. Randvoorwaarden: er is sprake van een volkomen bron in een freatisch pakket. De situatie is stationair. [Fraanje, Bronbemaling, pag. 44-45]','','','uploads/categories/thumbnails/Icoon_freatisch_alg_copy_1.gif',256,256,'',1),(5,4,'Onttrekkingsdebiet',1,'onttrekkingsdebiet',10,11,1,3,'Onttrekkingsdebiet','Bereken het bemalingsdebiet aan de hand van opgegeven verlaging.','','','uploads/categories/thumbnails/Icoon_freatisch_alg2_copy.gif',256,256,'',1),(6,4,'Verlaging',1,'verlaging',12,13,1,3,'Verlaging','Bereken de verlaging aan de hand van het opgegeven bemalingsdebiet.','','','uploads/categories/thumbnails/Icoon_freatisch_alg3_copy.gif',256,256,'',1),(7,NULL,'Peilverandering',1,'peilverandering',1,6,5,0,'Peilverandering','Berekening debiet en grondwaterstand bij peilverandering in een watergang.','','','uploads/categories/thumbnails/peilverandering.png',282,192,'',1),(8,7,'Debiet',1,'debiet',2,5,5,1,'Debiet','','','','uploads/categories/thumbnails/peilverandering.png',NULL,NULL,'',1),(9,8,'Verlaging peil',1,'verlaging-peil',3,4,5,2,'Verlaging peil','','','','uploads/categories/thumbnails/peilverandering.png',NULL,NULL,'',1),(10,NULL,'Drainage',1,'drainage',1,32,2,0,'Drainage','Berekenen van drainafstand bij een gewenste opbolling en opbolling bij een gekozen drainafstand.','','','uploads/categories/thumbnails/drainage.png',283,194,'',1),(11,12,'Opbolling',1,'opbolling',23,30,2,2,'Opbolling','Bereken de opbolling aan de hand van de gegeven drainafstand.','','','uploads/categories/thumbnails/Icoon_Hooghoudt1_copy.gif',256,256,'',1),(12,10,'Hooghoudt',1,'hooghoudt',14,31,2,1,'Hooghoudt','Toepasbaar voor een homogeen bodemprofiel of een tweelagenprofiel met de drains op de laagscheiding. ','','','uploads/categories/thumbnails/Icoon_Hooghoudt_copy.gif',256,256,'',1),(13,11,'Drains',1,'drains',24,25,2,3,'Drains','Berekening voor drains.\r\n','','','uploads/categories/thumbnails/Icoon_Drains_overview_copy_1.gif',256,256,'',1),(14,2,'Niet-stationair',1,'niet-stationair',3,8,1,2,'Niet-stationair','Voor deze situatie wordt de formule van Theis-Jacob-Edelman gebruikt. Randvoorwaarden: er is sprake van een volkomen bron in een freatisch pakket. De situatie is niet stationair. [SBR, Bemaling van Bouwputten,  pag. 30].','','','uploads/categories/thumbnails/Icoon_freatisch_alg4_copy.gif',256,256,'',1),(15,14,'Onttrekkingsdebiet',1,'onttrekkingsdebiet',4,5,1,3,'Onttrekkingsdebiet','Bereken het bemalingsdebiet aan de hand van opgegeven verlaging','','','uploads/categories/thumbnails/Icoon_freatisch_alg5_copy.gif',256,256,'',1),(16,14,'Verlaging',1,'verlaging',6,7,1,3,'Verlaging','Bereken de verlaging aan de hand van het opgegeven bemalingsdebiet','','','uploads/categories/thumbnails/Icoon_freatisch_alg6_copy.gif',256,256,'',1),(17,2,'Stationair (open water)',1,'stationair-open-water',21,26,1,2,'Stationair (open water)','Voor deze situatie wordt de formule van Forchheimer gebruikt. Randvoorwaarden: er is sprake van een volkomen bron in een freatisch pakket nabij open water. De situatie is stationair. [Fraanje, Bronbemaling, pag. 62-63]','','','uploads/categories/thumbnails/Icoon_freatisch_openwater1_copy.gif',256,256,'',1),(18,2,'Stationair (onvolkomen)',1,'stationair-onvolkomen',15,20,1,2,'Stationair (onvolkomen)','Voor deze situatie wordt de formule van Forchheimer gebruikt. Randvoorwaarden: er is sprake van een onvolkomen bron in een freatisch pakket. De situatie is stationair. [Fraanje, Bronbemaling, pag. 100].','','','uploads/categories/thumbnails/Icoon_freatisch_onvolkomen1-256.gif',256,256,'',1),(19,18,'Verlaging',1,'verlaging',18,19,1,3,'Verlaging','Bereken de verlaging aan de hand van het opgegeven bemalingsdebiet.','','','uploads/categories/thumbnails/Icoon_freatisch_onvolkomen3-256.gif',256,256,'',1),(20,18,'Onttrekkingsdebiet',1,'onttrekkingsdebiet',16,17,1,3,'Onttrekkingsdebiet','Bereken het bemalingsdebiet aan de hand van opgegeven verlaging.','','','uploads/categories/thumbnails/Icoon_freatisch_onvolkomen2-256.gif',256,256,'',1),(21,17,'Verlaging',1,'verlaging',24,25,1,3,'Verlaging','Bereken de verlaging aan de hand van het opgegeven bemalingsdebiet.','','','uploads/categories/thumbnails/Icoon_freatisch_openwater2_copy.gif',256,256,'',1),(22,17,'Onttrekkingsdebiet',1,'onttrekkingsdebiet',22,23,1,3,'Onttrekkingsdebiet','Bereken het bemalingsdebiet aan de hand van opgegeven verlaging.','','','uploads/categories/thumbnails/Icoon_freatisch_openwater3_copy.gif',256,256,'',1),(23,3,'Stationair',1,'stationair',35,40,1,2,'Stationair','Voor deze situatie wordt de formule van De Glee gebruikt. Randvoorwaarden: er is sprake van een volkomen bron in een freatisch pakket boven een watervoerend pakket. De situatie is stationair. [SBR, Bemaling van bouwputten, pag. 31-32].','','','uploads/categories/thumbnails/Icoon_freatisch_bovensp_copy_2.gif',256,256,'',1),(24,3,'Niet-stationair',1,'niet-stationair',29,34,1,2,'Niet-stationair','Voor deze situatie wordt de formule van Hantush-Jacob gebruikt. Randvoorwaarden: er is sprake van een volkomen bron in een freatisch pakket boven een watervoerend pakket. De situatie is niet stationair. [Kruseman & De Ridder, Analysis and Evaluation of Pumping Test Data, pag. 81-84]','','','uploads/categories/thumbnails/Icoon_freatisch_bovensp4_copy.gif',256,256,'',1),(25,1,'Semi-spanning',1,'semi-spanning',42,55,1,1,'Semi-spanning','Een watervoerende laag onder een slecht waterdoorlatende (dek)laag en op een ondoorlatende basis (SBR, 2003).','','','uploads/categories/thumbnails/Icoon_spanning_licht_copy.gif',256,256,'',1),(26,25,'Stationair',1,'stationair',49,54,1,2,'Stationair','Voor deze situatie wordt de formule van De Glee gebruikt. Randvoorwaarden: er is sprake van een volkomen bron in een watervoerend pakket onder een slecht doorlatende laag. De situatie is stationair. [Polytechnisch zakboek, 45e druk, pag. F2/43].','','','uploads/categories/thumbnails/Icoon_spanning_licht_copy_1.gif',256,256,'',1),(27,25,'Niet-stationair',1,'niet-stationair',43,48,1,2,'Niet-stationair','Voor deze situatie wordt de formule van Hantush-Jacob gebruikt. Randvoorwaarden: er is sprake van een volkomen bron in een watervoerend pakket onder een slecht doorlatende laag. De situatie is niet stationair. [Kruseman & De Ridder, Analysis and Evaluation of Pumping Test Data, pag. 81-84].','','','uploads/categories/thumbnails/Icoon_spanning_licht4_copy.gif',256,256,'',1),(28,27,'Verlaging',1,'verlaging',46,47,1,3,'Verlaging','Bereken de verlaging aan de hand van het opgegeven bemalingsdebiet.','','','uploads/categories/thumbnails/Icoon_spanning_licht6_copy.gif',256,256,'',1),(29,27,'Onttrekkingsdebiet',1,'onttrekkingsdebiet',44,45,1,3,'Onttrekkingsdebiet','Bereken het bemalingsdebiet aan de hand van opgegeven verlaging.','','','uploads/categories/thumbnails/Icoon_spanning_licht5_copy.gif',256,256,'',1),(30,26,'Onttrekkingsdebiet',1,'onttrekki