aanje, Bronbemaling, pag. 47-48]','','','uploads/categories/thumbnails/Icoon_spanning_donker_copy_1.gif',256,256,'',1),(38,36,'Stationair-wvp',1,'stationair-wvp',69,74,1,2,'Stationair-wvp','Voor deze situatie wordt de formule van Tessendorff gebruikt. Randvoorwaarden: er is sprake van een volkomen bron in een watervoerend pakket onder een niet doorlatende deklaag. De verlaging van de stijghoogte komt tot in het watervoerend pakket. De situatie is stationair. [Fraanje, Bronbemaling, pag. 59-61].','','','uploads/categories/thumbnails/Icoon_spanning_donker_wvp1_copy.gif',256,256,'',1),(39,36,'Niet-stationair',1,'niet-stationair',57,62,1,2,'Niet-stationair','Voor deze situatie wordt de formule van Theis-Jacob-Edelman gebruikt. Randvoorwaarden: er is sprake van een volkomen bron in een watervoerend pakket onder een niet-doorlatende deklaag. De situatie is niet stationair. [SBR, Bemaling van bouwputten, pag. 30].','','','uploads/categories/thumbnails/Icoon_spanning_donker4_copy.gif',256,256,'',1),(40,11,'Drains in grindkoffer',1,'drains-in-grindkoffer',26,27,2,3,'Drains in grindkoffer','Berekening voor drains in een grindkoffer.','','','uploads/categories/thumbnails/Icoon_Drains_grindbox_over_copy_1.gif',256,256,'',1),(41,11,'Sloten',1,'sloten',28,29,2,3,'Sloten','Berekening voor sloten.','','','uploads/categories/thumbnails/Icoon_Sloten_overview_copy_1.gif',256,256,'',1),(42,12,'Afstand',1,'afstand',15,22,2,2,'Afstand','Bereken de drainafstand aan de hand van de gegeven opbolling.','','','uploads/categories/thumbnails/Icoon_Hooghoudt2_copy.gif',256,256,'',1),(43,42,'Drains',1,'drains',16,17,2,3,'Drains','Berekening voor drains.','','','uploads/categories/thumbnails/Icoon_Drains_overview_copy.gif',256,256,'',1),(44,42,'Drains in grindkoffer',1,'drains-in-grindkoffer',18,19,2,3,'Drains in grindkoffer','Berekening voor drains in een grindkoffer.','','','uploads/categories/thumbnails/Icoon_Drains_grindbox_over_copy.gif',256,256,'',1),(45,42,'Sloten',1,'sloten',20,21,2,3,'Slo