halve zeer gevaarlijk om aan een van de drie berekende kengetallen (invloedssfeer, reikwijdte, spreidingslengte) absolute waarde te hechten (SBR, 2003, pag. 27).','','','uploads/categories/thumbnails/Icoon_freatisch_alg7_copy.gif',256,256,'',1),(60,58,'Spreidingslengte',1,'spreidingslengte',16,17,4,1,'Spreidingslengte','De spreidingslengte is een karakteristieke lengte die de maat is voor de afstand met merkbare invloed van de bemaling (SBR, 2003, pag. 28)','','','uploads/categories/thumbnails/Icoon_freatisch_alg10_copy.gif',256,256,'',1),(61,58,'Gemiddelde doorlatendheid en totale weerstand',1,'gemiddelde-doorlatendheid-en-totale-weerstand',4,5,4,1,'Gemiddelde doorlatendheid en weerstand','Berekening gemiddelde doorlatendheid en totale weerstand over meerdere lagen volgens SBR, 2003, pag. 27','','','uploads/categories/thumbnails/Icoon_gemKwaarde_copy.gif',256,256,'',1),(62,58,'Equivalente straal bouwput',1,'equivalente-straal-bouwput',2,3,4,1,'Equivalente straal bouwput','Berekening van de equivalente straal van een bouwput [ (L + B) / pi ] volgens SBR, 2003, pag. 97','','','uploads/categories/thumbnails/Icoon_iqstraal_copy.gif',256,256,'',1),(63,NULL,'Geotechnisch',1,'geotechnisch',1,2,3,0,'Geotechnisch','Geotechnische (risico)berekeningen met betrekking tot zetting en opbarsting.','','','uploads/categories/thumbnails/grond.png',281,193,'',1),(64,59,'Langdurige bemalingen',0,'langdurige-bemalingen',11,12,4,2,'Langdurige bemalingen','Berekening reikwijdte voor langdurige bemalingen. In de praktijk blijkt dat de reikwijdte (snijpunt van de raaklijn aan de kromme met de horizontale as) toeneemt met toenemende tijdsduur. Het is derhalve zeer gevaarlijk om aan een van de drie berekende kengetallen (invloedssfeer, reikwijdte, spreidingslengte) absolute waarde te hechten (SBR, 2003, pag. 27).','','','uploads/categories/thumbnails/Icoon_freatisch_alg7_copy_1.gif',256,256,'',1),(65,59,'Kortdurende bemalingen',0,'kortdurende-bemalingen',9,10,4,2,'Kortdurende bemalingen','Be