INSERT INTO `toolbox_newsitem` VALUES (5,'<font size=\"2\"><font face=\"Arial\"><font color=\"#000000\"><font size=\"3\"><font color=\"#8a7b66\">Inloggen en registreren</font></font>\r\n<p>\r\n	<span lang=\"NL\" style=\"mso-ansi-language: nl;\"><font size=\"3\"><font color=\"#000000\"><font face=\"Calibri\"><font face=\"Arial\" size=\"2\">Het is niet meer&nbsp; mogelijk om gratis te registreren op de grondwatertoolbox website. Vanaf 1 juli 2013 is een deel van de functionaliteit alleen nog beschikbaar voor de betalende gebruikers. Stuur een mailtje naar de <a href=\"mailto:info@acaciawater.com\" target=\"_self\">grondwatertoolbox </a></font></font></font></font></span><span lang=\"NL\" style=\"mso-ansi-language: nl;\"><font size=\"3\"><font color=\"#000000\"><font face=\"Calibri\"><font face=\"Arial\" size=\"2\"><a href=\"mailto:info@grondwatertoolbox.nl\" target=\"_self\"><span lang=\"NL\" style=\"mso-ansi-language: nl;\"><span style=\"color: rgb(0, 0, 0);\"></span></span></a>om te registreren.</font></font></font></font></span><font size=\"3\"><font color=\"#000000\"><font face=\"Calibri\"><font face=\"Arial\" size=\"2\">\r\n	<br>\r\n	</font>\r\n	<o:p>\r\n	</o:p>\r\n	</font></font></font>\r\n</p>\r\n</font></font></font>\r\n',2,'2013-05-08 11:07:32','2014-09-03 14:19:23');
